class Solution:
    def maxProfit(self, prices: List[int]) -> int:
        if not prices:
            return 0

        n = len(prices)

        # Left pass: Maximum profit up to day i (first transaction)
        left_profits = [0] * n
        min_price = prices[0]

        for i in range(1, n):
            min_price = min(min_price, prices[i])  # Keep track of the minimum price so far
            left_profits[i] = max(left_profits[i-1], prices[i] - min_price)  # Max profit by day i

        # Right pass: Maximum profit from day i onwards (second transaction)
        right_profits = [0] * n
        max_price = prices[n-1]

        for i in range(n-2, -1, -1):
            max_price = max(max_price, prices[i])  # Keep track of the maximum price so far
            right_profits[i] = max(right_profits[i+1], max_price - prices[i])  # Max profit from day i

        # Combine: Find the max sum of left and right profits
        max_total_profit = 0
        for i in range(n):
            max_total_profit = max(max_total_profit, left_profits[i] + right_profits[i])

        return max_total_profit

