class Solution:
    def longestConsecutive(self, nums: List[int]) -> int:
        res = 0
        numSet = set(nums)
        for n in nums:
            if (n - 1) in numSet:
                continue
            else:
                length = 0
                while (n + length) in numSet:
                    length += 1
                res = max(res, length)
        return res


