    def dijkstra(self, beginWord: str, endWord) -> int:
        dists = {}
        preds = {}

        queue = PriorityQueue()
        queue.put((0, beginWord))
        dists[beginWord] = 0
        preds[beginWord] = None

        while not queue.empty():
            dist, word = queue.get()

            if word == endWord:
                break

            for neighbor in self.get_adjacent_2(word):
                #new_dist = dists[word] + 1 + self.heuristic(neighbor, endWord)
                new_dist = dists[word] + 1
                if neighbor not in dists or new_dist < dists[neighbor]:
                    dists[neighbor] = new_dist
                    preds[neighbor] = word
                    queue.put((new_dist, neighbor))

        return dists, preds


    def ladderLength(self, beginWord: str, endWord: str, wordList: List[str]) -> int:
        self.wordList = wordList
        self.wordSet = set(wordList)

        dists, preds = self.dijkstra(beginWord, endWord)

        if endWord not in dists:
            return 0

        return dists[endWord] + 1

        path = [endWord]
        word = endWord
        while preds[word] is not None:
            word = preds[word]
            path = [word] + path

        return path

