class Solution:
    def ladderLength(self, beginWord: str, endWord: str, wordList: List[str]) -> int:
        if not endWord in wordList:
            return 0

        if beginWord == endWord:
            return 1

        def creatDictNode():
            node = {}
            for i in range(26):
                c = chr(ord('a') + i)
                node[c] = None
            return node

        class dictTree:
            def __init__(self):
                self.root = creatDictNode()

            def insert(self, s):
                cur = self.root
                for i in range(len(s) - 1):
                    c = s[i]
                    if cur[c] == None:
                        cur[c] = creatDictNode()
                    cur = cur[c]
                cur[s[-1]] = True

            def check(self, s):
                cur = self.root
                for i in range(len(s) - 1):
                    c = s[i]
                    cur = cur[c]
                    if cur == None:
                        return False
                return cur[s[-1]] == True                    

        tree = dictTree()
        for word in wordList:
            tree.insert(word)

        visit = dictTree()

        def connected(a, b):
            count = 0
            for ac, bc in zip(a, b):
                if not (ac == bc):
                    count += 1
                if count > 1:
                    return False
            return True

        from queue import PriorityQueue
        class Data:
            def __init__(self, s, d):
                self.s = s
                self.d = d

            # sort from smallest to largest
            def __lt__(self, other):
                return self.d < other.d

        q = PriorityQueue()
        q.put(Data(beginWord, 1))

        while not q.empty():
            data = q.get()
            s, d = data.s, data.d
            if connected(s, endWord):
                return d + 1

            s_cpy = list(s)
            for i in range(len(s)):
                old_c = s_cpy[i]
                for j in range(26):
                    s_cpy[i] = chr(ord('a') + j)

                    if tree.check(s_cpy):
                        if not visit.check(s_cpy):
                            visit.insert(s_cpy)
                            q.put(Data(''.join(s_cpy), d + 1))
                s_cpy[i] = old_c

        return 0

