class Solution:

    def getWildcards(self, word):
        return [word[:i] + "*" + word[i+1:] for i in range(len(word))]

    def buildNeighbors(self, wordList):
        """
        hack: map wildcards to words

        *uck --> fuck 
        *uck --> duck

        adjacent words share the same wildcard.

        getNeighbor(word) = map.get(wildcard(word))
        """

        self.wildcardToWord = defaultdict(set)
        for word in wordList:
            for wildcard in self.getWildcards(word):
