        while q:
            for _ in range(len(q)):
                curr = q.popleft()
                if curr == endWord:
                    return length
                visited.add(curr)
                for n in self.getNeighbors(curr):
                    if n in visited:
                        continue
                    q.append(n)
            length += 1
        return 0

