    def ladderLength(self, beginWord: str, endWord: str, wordList: List[str]) -> int:
        if endWord not in wordList:
            return 0

        def has_exact_diff(w1, w2, num_diff):
            index = 0
            diff_cnt = 0
            while index < len(w1):
                diff_cnt += w1[index] != w2[index]
                index += 1
            return diff_cnt == num_diff

        def get_children(_words, w):
            return {ch for ch in _words if has_exact_diff(w, ch, num_diff=1)}

        def run_bi_bfs_once(q, _words, visited, other_visited):
            que_size = len(q)
            # Has to finish each level before you can progress on the next level
            for _ in range(que_size):
                word = q.popleft()
                for child in get_children(_words, word):
                    if child in other_visited:
                        return other_visited[child] + visited[word]
                    if child not in visited:
                        visited[child] = visited[word] + 1
                        q.append(child)
            return None

        # Bi-directional BFS
        words = set(wordList) | {beginWord}

        # Srouce 
        q_src = collections.deque([beginWord])
        visited_src = {beginWord: 1}
        # Destination
        q_dst = collections.deque([endWord])
        visited_dst = {endWord: 1}

        total_node_count = None
        while q_src and q_dst:
            # Progress forward from the shorter queue
            if len(q_src) <= len(q_dst):
                total_node_count = run_bi_bfs_once(q_src, words, visited_src, visited_dst)
            else:
                total_node_count = run_bi_bfs_once(q_dst, words, visited_dst, visited_src)
            if total_node_count is not None:
                return total_node_count

        return 0

