class Solution:
    def maximumGap(self, nums: List[int]) -> int:
        if len(nums) < 2:
            return 0

        min_num, max_num = min(nums), max(nums)
        if min_num == max_num:
            return 0

        n = len(nums)
        bucket_size = max(1, (max_num - min_num) // (n - 1))
        bucket_num = (max_num - min_num) // bucket_size + 1
        buckets = [None] * bucket_num

        for num in nums:
            idx = (num - min_num) // bucket_size
            if buckets[idx] is None:
                buckets[idx] = {'min': num, 'max': num}
            else:
                buckets[idx]['min'] = min(buckets[idx]['min'], num)
                buckets[idx]['max'] = max(buckets[idx]['max'], num)

        max_gap = 0
        prev_max = min_num
        for bucket in buckets:
            if bucket is not None:
                max_gap = max(max_gap, bucket['min'] - prev_max)
                prev_max = bucket['max']

        return max_gap

