class Solution:
    def canJump(self, nums: List[int]) -> bool:
        ans = [False]*len(nums)
        ans[-1] = True
        for idx in range(len(nums)-2,-1,-1):
            val = nums[idx]
            for neighbourIdx in range(idx+1,idx+val+1):
                if ans[neighbourIdx]:
                    ans[idx]=True
                    break
        return ans[0]

    def brute_force_canJump(self, nums: List[int]) -> bool:
        possible = [False]*len(nums)
        possible[-1] = True
        for idx in range(len(nums)-2,-1,-1):
            end = min(len(nums), idx + nums[idx])
            for i in range(idx + 1, end + 1):
                if possible[i]:
                    possible[idx] = True
                    break
        return possible[0]

    def optimal_canJump(self, nums: List[int]) -> bool:
        minIndexRight = len(nums) - 1
        possible = [False]*len(nums)
        possible[-1] = True
        for idx in range(len(nums) - 2, -1, -1):
            if minIndexRight <= idx + nums[idx]:
                minIndexRight = idx
                possible[idx] = True
        return possible[0]

    def optimal_no_array_canJump(self, nums: List[int]) -> bool:
