                minIndexRight = idx
        return minIndexRight == 0

    def memoization_canJump(self, nums: List[int]) -> bool:
        dp = [-1] * len(nums)
        dp[-1] = True

        def dfs(idx):
            if dp[idx] != -1:
                return dp[idx]
            dp[idx] = False
            last_possible_idx = min(len(nums) - 1, idx + nums[idx])
            for i in range(idx + 1, last_possible_idx + 1):
                if dfs(i):
                    dp[idx] = True
                    break
            return dp[idx]

        return dfs(0)

    def most_optimal_canJump(self, nums: List[int]) -> bool:
        n = len(nums)
        dp = [False] * n
