class Solution:
    def isMatch(self, s: str, p: str) -> bool:
        groups = []

        for chars in p.split('*'):

            if not chars:
                continue

            for char in chars[:-1]:
                groups.append((char, False))

            if chars[-1]:
                groups.append((chars[-1], True))

        if p[-1] != '*':  # rewrite last group is not a * match.
            groups[-1] = (groups[-1][0], False)
        regex = ''
