class Solution:
    def maxSumOfThreeSubarrays(self, nums: List[int], k: int) -> List[int]:
        presum = [0 for _ in nums]
        for i in range(len(nums)):
            presum[i] = (presum[i-1] if i > 0 else 0) + nums[i]

        left_max = [None for _ in nums]
        right_max = [None for _ in nums]

        for i in range(len(nums)-k+1):
            cur_sum = presum[i + k - 1] - (presum[i-1] if i > 0 else 0)
            if i == 0:
                left_max[i] = (i, cur_sum)
            else:
                if cur_sum > left_max[i-1][1]:
                    left_max[i] = (i, cur_sum)
                else:
                    left_max[i] = left_max[i-1]

        for i in range(len(nums)-k, -1, -1):
            cur_sum = presum[i + k - 1] - (presum[i-1] if i > 0 else 0)
            if i == len(nums)-k:
                right_max[i] = (i, cur_sum)
            else:
                if cur_sum >= right_max[i+1][1]:
                    right_max[i] = (i, cur_sum)
                else:
                    right_max[i] = right_max[i+1]

        max_value = None
        max_path = None

        for i in range(k, len(nums) - k - k + 1):
            total = left_max[i-k][1] + right_max[i + k][1] + sum(nums[i : i + k])
