class Solution:
    def reverseOnlyLetters(self, s: str) -> str:
        p = 0
        q = len(s) - 1
        s = list(s)
        while p < q:
            if s[p].isalpha() and s[q].isalpha():
                s[p], s[q] = s[q], s[p]
                p += 1
                q -= 1
            elif s[p].isalpha() and not s[q].isalpha():
                q -= 1
            elif not s[p].isalpha() and s[q].isalpha():
                p += 1
            elif not s[p].isalpha() and not s[q].isalpha():
                q -= 1
                p += 1
        s = ''.join(s)
        return s

