class Solution:
    def superEggDrop(self, k: int, n: int) -> int:
        '''
        if an egg breaks on x, we know that the floor is between 0 and x-1 and we have k-1 eggs left

        if the egg doesnt break, we know that the floor is between x and n (n-x) floors and we have k eggs left


        we can use dp to try all combinations to find the most optimal one to drop

        2dp dp.

        tle with k*n^2

        try to get down to k*n*lgn
        '''
        @cache
        def dfs(k, n):
            if k == 1:
                return n
            if n == 0:
                return 0

            l = 1
            r = n
            res = float('inf')

            while l <= r:
                m = (l + r)//2

                left, right = dfs(k-1, m-1), dfs(k, n-m)
                res = min(res, 1 + max(left, right))

                if left < right:
                    l = m + 1
                else:
                    r = m - 1

            return res

        return dfs(k, n)

